import React, { useState, useEffect } from 'react';
import '../styles/login.component.style.scss';
import { registerActions } from '../actions/userActions';
import store from '../store/store';
import { Redirect, Link } from 'react-router-dom';

function AddEntry() {
	const [name, setName] = useState('');
	const [bday, setBday] = useState('');
	const [bootCamp, setBootCamp] = useState('');
	const [email, setEmail] = useState('');
	const [password, setPassword] = useState('');
	const [register, setRegister] = useState(null);

	useEffect(() => {
		store.addChangeListener(onChange);

		return () => {
			return store.removeChangeListener(onChange);
		};
	}, [register]);

	function onChange() {
		setRegister(store.getRegister());
	}

	if (register) {
		store.setRegister();
		return <Redirect to="/" />;
	}
	function addNewEntry() {
		return true;
	}

	return (
		<>
			<div className="newEntry-holder flex-col">
				<form action="javascript:void(0)" onSubmit={addNewEntry}></form>
			</div>
		</>
	);
}

export default AddEntry;
